/* ng-scroll-event - v1.0.0 - 2014-01-15 */
var mod;

mod = angular.module('scroll-event', []);

mod.directive("scrollEvent", [ '$window',
  function ($window) {
    return function(scope, element, attrs) {
      angular.element($window).bind("scroll", function() {
        scope.boolPadLeft = false;
        if (window.innerWidth < 800) {
          if (this.pageYOffset >= 1) {
            scope.boolMakeFloat = true;
          } else {
            scope.boolMakeFloat = false;
          }
        }
        /* if (window.innerWidth < 800 && scope.boolMakeFloat) {
          // mobile and floating
          $("#main").css("padding-top", $("#facets").height());
        } else if (window.innerWidth > 800 && scope.boolMakeFloat) {
          // desktop and floating
          scope.boolPadLeft = true;
        } else {
          $("#main").css("padding-top", 0);
        } */
        // console.log("scrolled: ", scope, scope.boolMakeFloat);
        scope.$apply();
      });
    };
  }
]);
/* ng-slider-grades - v1.0.0 - 2014-01-22 */
var mod;

mod = angular.module('slider-grades', []);

/*
 The name of this directive is camelCase, which is correct
 However, when using the directive in your view, you must convert it to snake case
 Find out more here http://docs.angularjs.org/guide/directive
*/
mod.directive('sliderGrades', [
  function() {
    return {
      link: function(scope, elem, attrs) {
        $(elem).slider({
            range: true,
            min: scope.grades[0],
            max: scope.grades[scope.grades.length-1],
            values: scope.grade_values,
            slide: function( event, ui ) {
              scope.grade_values[0] = ui.values[0];
              scope.grade_values[1] = ui.values[1];
              scope.$apply();
            },
            stop: function( event, ui ) {
              scope.onGradeSliderStop && scope.onGradeSliderStop(ui.values[0], ui.values[1]);
            }
        });
      }
    }
  }
]);
/* ng-slider-lexiles - v1.0.0 - 2014-01-22 */
var mod;

mod = angular.module('slider-lexiles', []);

/*
 The name of this directive is camelCase, which is correct
 However, when using the directive in your view, you must convert it to snake case
 Find out more here http://docs.angularjs.org/guide/directive
*/
mod.directive('sliderLexiles', [
  function() {
    return {
      link: function(scope, elem, attrs) {
        // console.log(scope.lexiles);
        $(elem).slider({
            range: true,
            min: scope.min_lexile,
            max: scope.max_lexile,
            step: 10,
            values: scope.lexile_values,
            slide: function( event, ui ) {
              scope.lexile_values[0]= ui.values[0];
              scope.lexile_values[1] = ui.values[1];
              scope.$apply();
              // console.log(ui.values[0], ui.values[1], ui);
            },
            stop: function( event, ui ) {
              scope.onLexileSliderStop && scope.onLexileSliderStop(ui.values[0], ui.values[1]);
            }
        });
      }
    }
  }
]);
'use strict';

// The main app module
var app = angular.module('MyLibraryNYCApp',['ngRoute','ngCookies','infinite-scroll','scroll-event','slider-grades']);

// URL parsing for breadcrumb
app.filter('regex', function() {
  return function(text, regex) {
    var patt = new RegExp(regex);
    if(text == undefined || text == "")
      return false;
    if(patt.test(text))
        return true;
    return false;
  };
});

// Define routes here
app.config([ '$locationProvider', '$routeProvider', '$httpProvider',
  function($locationProvider, $routeProvider, $httpProvider) {
    // $locationProvider.html5Mode(true);
    $httpProvider.defaults.headers.common['X-CSRF-Token'] = $('meta[name=csrf-token]').attr('content');
    $routeProvider.
      when('/teacher_sets', {
        templateUrl: '/templates/teacher_sets/list.html',
        controller: 'TeacherSetListCtrl',
        reloadOnSearch: false // don't repaint everything for faceting
      }).
      when('/teacher_sets/:id', {
        templateUrl: '/templates/teacher_sets/detail.html',
        controller: 'TeacherSetDetailCtrl'
      }).
      when('/holds/new', {
        templateUrl: '/templates/holds/new.html',
        controller: 'HoldNewCtrl'
      }).
      when('/holds/:id', {
        templateUrl: '/templates/holds/detail.html',
        controller: 'HoldDetailCtrl'
      }).
      when('/holds/:id/cancel', {
        templateUrl: '/templates/holds/cancel.html',
        controller: 'HoldCancelCtrl'
      }).
      when('/books/:id', {
        templateUrl: '/templates/books/detail.html',
        controller: 'BookDetailCtrl'
      }).
      otherwise({
        redirectTo: '/teacher_sets'
      });
  }
]);
'use strict';

app.factory('TeachSetListFactory', [ '$http', '$routeParams', '$location',
  function($http, $routeParams, $location) {
    var TeachSetListFactory = function() {
      localStorage.clear();
      this.items = [];
      this.errors = {};
      this.facets = [];
      this.busy = false; // whether service is *actually* busy
      this.showBusy = false; // whether or not to show that we are busy
      this.busyTimer = null;
      this.busyTimerSeconds = 1000; // show busy messaging after x milliseconds
      this.page = 0;
      this.queryParams = $routeParams || {};

      this.active_keyword = this.queryParams.keyword;

      this.queryString = this.parameterize(this.queryParams);
      this.facetString = this.getFacetString(this.queryParams);
    };

    TeachSetListFactory.prototype.cancelBusyMessage = function(){
      if (this.busyTimer) clearTimeout(this.busyTimer);
      this.showBusy = false;
    };

    TeachSetListFactory.prototype.doFilter = function(params) {
      if (this.busy) return;
      this.resetPages();
      this.doRequest(params);
    };

    TeachSetListFactory.prototype.doGrades = function(grade_begin, grade_end){
      if (this.busy) return;
      this.resetPages();
      this.queryParams.grade_begin = grade_begin;
      this.queryParams.grade_end = grade_end;
      $location.path('/teacher_sets').search(this.queryParams);
      this.doRequest(this.queryParams);
    };

    TeachSetListFactory.prototype.doLexiles = function(lexile_begin, lexile_end){
      if (this.busy) return;
      this.resetPages();
      this.queryParams.lexile_begin = lexile_begin;
      this.queryParams.lexile_end = lexile_end;
      $location.path('/teacher_sets').search(this.queryParams);
      this.doRequest(this.queryParams);
    };

    TeachSetListFactory.prototype.doRequest = function(params){
      if (this.busy) return;
      params = params || this.queryParams;
      var that = this;
      this.busy = true;
      this.queueBusyMessage();
      this.queryParams = params;
      this.queryString = this.parameterize(params);
      this.facetString = this.getFacetString(params);
      $http.get('/teacher_sets.json?'+this.queryString).success(function(data) {
        // append results to current results
        $.merge(that.items, data.teacher_sets);
        // only load facets once
        if (!that.facets.length) {
          that.facets = data.facets;
        // only refresh facets on first page
        } else if (that.page <= 1) {
          that.repaintFacets(data.facets);
        }
        if (that.errors) {
          that.errors = data.errors;
        }
        that.busy = false;
        that.cancelBusyMessage();
        that.lastTeacherSetCount = data.teacher_sets.length
      });
    };

    TeachSetListFactory.prototype.doSearch = function() {
      if (this.busy) return;

      this.resetPages();
      this.active_keyword = this.queryParams.keyword;

      if ( !this.queryParams.keyword.length ) {
        delete this.queryParams.keyword;
      }

      $location.path('/teacher_sets').search(this.queryParams);
      this.doRequest(this.queryParams);
    };

    TeachSetListFactory.prototype.getFacetString = function(params) {
      if ( params.page ) {
        delete params.page;
      }
      return this.parameterize(params);
    };

    TeachSetListFactory.prototype.nextPage = function() {
      if (this.lastTeacherSetCount == 0) return;
      if (this.busy) return;
      this.page++;
      this.queryParams.page = this.page;
      this.doRequest(this.queryParams);
    };

    TeachSetListFactory.prototype.parameterize = function(obj){
      return $.param(obj).replace(/%2B/g,'+');
    };

    TeachSetListFactory.prototype.queueBusyMessage = function(){
      var that = this;
      if ( this.queryParams.page > 1 ) {
        this.showBusy = true;
      // delay loading message on first page to avoid "flicker"
      } else {
        this.busyTimer = setTimeout(function(){
            that.showBusy = true;
        }, this.busyTimerSeconds );
      }

    };

    TeachSetListFactory.prototype.removeKeyword = function(){
      this.queryParams.keyword = '';
      this.doSearch();
    };

    TeachSetListFactory.prototype.repaintFacets = function(newFacets) {
      var that = this;

      $.each( this.facets, function( i, f ) {
        that.facets[i].items = newFacets[i].items;
      });

    };

    TeachSetListFactory.prototype.resetPages = function() {
      this.page = 1;
      this.items = [];
      if ( this.queryParams.page ) {
        delete this.queryParams.page;
      }
    };

    return TeachSetListFactory;
  }
]);
'use strict';

